const gymgraphStyle = theme => ({
    paper: {
        height: "inherit",
    },
    container: {
        paddingTop: "3rem"
    },
    modal: {
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
    },
})

export default gymgraphStyle;
